styles:
:root {
    --color-primary: hsl(43, 50%, 70%);
    --color-negative: hsl(0, 70%, 70%);
    --color-text-base: hsl(240, 8%, 58%);
    --color-text-paragraph: hsl(240, 8%, 73%);
    --color-background: hsl(240, 8%, 9%);
    --color-widget-background: hsl(240, 8%, 10%);
    --color-widget-border: hsl(240, 8%, 13%);
    --border-radius: 5px;
    --content-padding: 15px;
    --widget-gap: 23px;
    font-size: 10px;
}

* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

body {
    font-family: 'JetBrains Mono', monospace;
    font-size: 1.3rem;
    line-height: 1.6;
    color: var(--color-text-base);
    background-color: var(--color-background);
    height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
}

.content-bounds {
    width: 100%;
    max-width: 700px;
    padding: 0 var(--content-padding);
    margin-top: -10rem;
}

.widget-frame {
    background: var(--color-widget-background);
    border: 1px solid var(--color-widget-border);
    border-radius: var(--border-radius);
    padding: var(--widget-gap);
    margin-top: 1rem;
    box-shadow: 0px 3px 0px 0px hsl(240, 8%, 8.5%);
}

.error-title {
    color: var(--color-negative);
    font-size: 1.2rem;
    text-transform: uppercase;
    padding: 0 var(--content-padding);
}

.error-text {
    color: var(--color-text-paragraph);
    line-height: 1.9;
}

ol {
    padding: 20px 40px;
    counter-reset: item;
}

ol li {
    list-style: none;
    margin: 10px 0;
    position: relative;
}

ol li:before {
    content: counter(item) "";
    counter-increment: item;
    position: absolute;
    left: -40px;
    width: 25px;
    height: 25px;
    background-color: hsl(215, 73%, 59%);
    color: white;
    border-radius: 50%;
    text-align: center;
    line-height: 25px;
    font-size: 14px;
}

.contact-text {
    margin-top: 15px;
    color: var(--color-text-base);
}

a {
    color: var(--color-primary);
    text-decoration: none;
}

a:hover {
    text-decoration: underline;
}

@media (max-width: 550px) {
    :root {
        font-size: 9px;
        --content-padding: 10px;
        --widget-gap: 15px;
    }

    .content-bounds {
        margin-top: -5rem;
    }

    ol {
        padding: 15px 35px;
    }

    ol li:before {
        left: -35px;
        width: 22px;
        height: 22px;
        line-height: 22px;
        font-size: 12px;
    }
}
